import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {
    return (
        <div className='tc'>
            {
                robots.map((user, i) => ( 
                    <Card
                    key={i} 
                    id={robots[i].id} 
                    name={robots[i].name} 
                    email={robots[i].email}
                    />
                )).sort((a,b) => a.name - b.name)
            }
        </div>
    )
}

export default CardList;
